	static Matrix evolveWeights() throws Exception
	{
		// Create a random initial population
		Random r = new Random();
		Matrix population = new Matrix(100, 295);
		for(int i = 0; i < 100; i++)
		{
			double[] chromosome = population.row(i);
			for(int j = 0; j < chromosome.length-3; j++)
				chromosome[j] = 0.03* r.nextGaussian(); 
			
			chromosome[291] = 0.25;
			chromosome[292] = 0.1;
			chromosome[293] = 0.55;
			chromosome[294] = 1;
			
		}

		int generationCount = 0;
        while (generationCount<10000)
		{
			System.out.println(generationCount + "		" + 20000/Algorithm.fittest + "		"+Algorithm.fittest);
            generationCount++;
            population = Algorithm.evolvePopulation(population);
        }
        System.out.println("Solution found!");
        System.out.println("Generation: " + generationCount);
 


		// Return the evolved population
		return population;
	}

	public static double[] getFittest(Matrix population) throws Exception
	{
		double[] fittest = null;
		int lowestFitness = 1000000;
		for(int i=0; i<population.rows(); i++)
		{
	
			double[] w = population.row(i);
			double[] indiv = new double[291];
			System.arraycopy(w, 0, indiv, 0, 291);
			int indivFitness = Game.getFitness(indiv);
			
			if(indivFitness > 0 && indivFitness < lowestFitness)
			{	
				fittest = indiv;
				lowestFitness = indivFitness;
			}
	
		}
		
		return fittest;
	}

	public static int getFitness(double[] indiv) throws Exception
	{
		Controller.time = 0;
		int fitness =  Controller.doBattleNoGui(new ReflexAgent(),new NeuralAgent(indiv));
		Controller.time = 0;
		return fitness;
	}
	
